import React, { useState, useEffect } from 'react';
import { PlusCircle } from 'lucide-react';
import { getTrades, addTrade, updateTrade, deleteTrade } from '../services/api';
import { Button } from '../components/ui/Button';
import { Card, CardContent, CardHeader, CardTitle } from '../components/ui/Card';
import Modal from '../components/ui/Modal';
import CumulativeProfitChart from '../components/CumulativeProfitChart';
import TradeCard from '../components/TradeCard';
import TradeForm from '../components/TradeForm';
import TradeDetailsModal from '../components/TradeDetailsModal';

const DashboardPage = () => {
    const [trades, setTrades] = useState([]);
    const [isModalOpen, setIsModalOpen] = useState(false);
    const [selectedTrade, setSelectedTrade] = useState(null);
    const [isDetailsModalOpen, setIsDetailsModalOpen] = useState(false);

    useEffect(() => {
        loadTrades();
    }, []);

    const loadTrades = async () => {
        try {
            const response = await getTrades();
            setTrades(response.data);
        } catch (error) {
            console.error("Failed to load trades:", error);
        }
    };

    const handleAddTrade = async (tradeData) => {
        try {
            // Calcular o resultado automaticamente se ambos os preços estiverem definidos
            let resultado = 0;
            if (tradeData.preco_entrada && tradeData.preco_saida && tradeData.quantidade) {
                const entrada = parseFloat(tradeData.preco_entrada);
                const saida = parseFloat(tradeData.preco_saida);
                const quantidade = parseFloat(tradeData.quantidade);

                if (tradeData.tipo === 'Compra') {
                    resultado = (saida - entrada) * quantidade;
                } else {
                    resultado = (entrada - saida) * quantidade;
                }
            }

            const tradeWithResult = {
                ...tradeData,
                resultado
            };

            await addTrade(tradeWithResult);
            setIsModalOpen(false);
            loadTrades(); // Recarregar a lista de trades
        } catch (error) {
            console.error("Erro ao adicionar trade:", error);
            throw error;
        }
    };

    const handleUpdateTrade = async (tradeId, tradeData) => {
        try {
            // Calcular o resultado automaticamente se ambos os preços estiverem definidos
            let resultado = 0;
            if (tradeData.preco_entrada && tradeData.preco_saida && tradeData.quantidade) {
                const entrada = parseFloat(tradeData.preco_entrada);
                const saida = parseFloat(tradeData.preco_saida);
                const quantidade = parseFloat(tradeData.quantidade);

                if (tradeData.tipo === 'Compra') {
                    resultado = (saida - entrada) * quantidade;
                } else {
                    resultado = (entrada - saida) * quantidade;
                }
            }

            const tradeWithResult = {
                ...tradeData,
                resultado
            };

            await updateTrade(tradeId, tradeWithResult);
            setIsDetailsModalOpen(false);
            loadTrades(); // Recarregar a lista de trades
        } catch (error) {
            console.error("Erro ao atualizar trade:", error);
            throw error;
        }
    };

    const handleDeleteTrade = async (tradeId) => {
        try {
            await deleteTrade(tradeId);
            setIsDetailsModalOpen(false);
            loadTrades(); // Recarregar a lista de trades
        } catch (error) {
            console.error("Erro ao excluir trade:", error);
            throw error;
        }
    };

    const handleTradeClick = (trade) => {
        setSelectedTrade(trade);
        setIsDetailsModalOpen(true);
    };

    const totalProfit = trades.reduce((acc, trade) => acc + (parseFloat(trade.resultado) || 0), 0);
    const totalTrades = trades.length;
    const winRate = totalTrades > 0 ? (trades.filter(t => t.resultado > 0).length / totalTrades) * 100 : 0;

    return (
        <div className="flex flex-col h-screen">
            <header className="sticky top-0 z-10 flex items-center justify-between h-16 px-4 border-b shrink-0 bg-background md:px-6">
                <h1 className="text-lg font-semibold">Trade Journal</h1>
                <Button onClick={() => setIsModalOpen(true)}>
                    <PlusCircle className="w-4 h-4 mr-2" />
                    Novo Trade
                </Button>
            </header>

            <main className="flex-1 overflow-auto p-4 md:p-8">
                <div className="grid gap-4 md:grid-cols-2 lg:grid-cols-4 mb-8">
                    <Card>
                        <CardHeader className="flex flex-row items-center justify-between pb-2 space-y-0">
                            <CardTitle className="text-sm font-medium">Lucro Total</CardTitle>
                        </CardHeader>
                        <CardContent>
                            <div className={`text-2xl font-bold ${totalProfit >= 0 ? 'text-green-500' : 'text-red-500'}`}>
                                R$ {totalProfit.toFixed(2)}
                            </div>
                        </CardContent>
                    </Card>
                    <Card>
                        <CardHeader className="flex flex-row items-center justify-between pb-2 space-y-0">
                            <CardTitle className="text-sm font-medium">Taxa de Acerto</CardTitle>
                        </CardHeader>
                        <CardContent>
                            <div className="text-2xl font-bold">{winRate.toFixed(1)}%</div>
                        </CardContent>
                    </Card>
                    <Card>
                        <CardHeader className="flex flex-row items-center justify-between pb-2 space-y-0">
                            <CardTitle className="text-sm font-medium">Total de Trades</CardTitle>
                        </CardHeader>
                        <CardContent>
                            <div className="text-2xl font-bold">{totalTrades}</div>
                        </CardContent>
                    </Card>
                </div>

                <div className="grid gap-8 lg:grid-cols-2">
                    <div>
                        <CumulativeProfitChart trades={trades} />
                    </div>

                    <div>
                        <h2 className="mb-4 text-2xl font-bold">Histórico de Trades</h2>
                        <div className="grid gap-4 sm:grid-cols-2 lg:grid-cols-1 xl:grid-cols-2">
                            {trades.map(trade => (
                                <TradeCard 
                                    key={trade.id} 
                                    trade={trade} 
                                    onClick={handleTradeClick}
                                />
                            ))}
                        </div>
                    </div>
                </div>
            </main>

            {/* Modal para adicionar novo trade */}
            <Modal
                isOpen={isModalOpen}
                onClose={() => setIsModalOpen(false)}
                title="Adicionar Novo Trade"
            >
                <TradeForm
                    onAddTrade={handleAddTrade}
                    onCancel={() => setIsModalOpen(false)}
                />
            </Modal>

            {/* Modal para detalhes/edição do trade */}
            <TradeDetailsModal
                isOpen={isDetailsModalOpen}
                onClose={() => setIsDetailsModalOpen(false)}
                trade={selectedTrade}
                onUpdateTrade={handleUpdateTrade}
                onDeleteTrade={handleDeleteTrade}
            />
        </div>
    );
};

export default DashboardPage;
